    value: This amendment is in response to a FEC Notice dated 11-25-08 with a response
      date of 12-29-08 concerning election to date totals.  This is our response,
      we will not send a letter via mail.  We are electronically filing the changes
      with our written explaination here in a memo form.  There was an error in the
      data base concerning Don Tripp.  He was in the data base twice that is why there
      were two different ECTD totals instead of one.  On this report the files have
      been merged so now there is one data set for Don Tripp.  We also redesignated
      the 10-6-08 contribution from general to primary debt with in the 60 day time
      period.  This still leaves the contributor over by $250.  This amount will be
      refunded and reported on the year end report.  The other contributor on the
      FEC Notice was Holm Bursum.  The original reported data here is correct.  The
      contribution for $250 on 9-22-08 was reported seperately because that contribution
      was from his son.  They both have the same name.  If you look at that contribution
      you will note a different address.
